import React from 'react'
import useStyles from "./styles"
const Description = () => {
    const classes = useStyles();
    return (
        <div className={classes.container}>
            <img src="https://images.unsplash.com/photo-1504674900247-0877df9cc836?ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&ixlib=rb-1.2.1&auto=format&fit=crop&w=1950&q=80"
            alt="Hero Img"
            className={classes.image}
            width="100px"
            />
        </div>
    )
}

export default Description
